import React from "react";
import "./navbar.scss";

export default function navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <h1>
          Lets<span>G</span>
          row<span>M</span>ore
        </h1>
      </div>
      <div className="menu-items">
        <ul>
          <li>
            <button className="getUsers">Get Users</button>
          </li>
        </ul>

        {/* <button className="getUsers">
                    Get Users
                </button> */}
      </div>
    </div>
  );
}
